INSERT INTO `deparment` VALUES (1,'儿科','一楼','该科主要开展儿科各系统疾病，部分新生儿科疾病等诊疗技术，专长于呼吸系统、消化系统、泌尿系统及其他疑难危重等疾病的治疗。 主要收治小儿肺炎、小儿肠炎、小儿脑炎、急慢性肾炎、肾病综合征、颅内感染、癫痫、血液病、各种风湿性疾病，近期开展小儿多动症、孤独症、自闭症的诊治，及设置小儿ICU病房。','2019-01-23 00:51:42'),(2,'产科','二楼','产科是一个集医疗、教学、科研和预防为一体的科室。全体医护人员基础理论扎实，临床经验丰富，多年来在正常妊娠分娩、高危妊娠的管理和围产保健、妇科疾病治疗及危重病例抢救方面积累了丰富的经验。','2019-01-03 21:01:41'),(3,'妇科','三楼','妇科是技术全面，服务优良的综合性科室。实际开放病床20张，全科医护人员17人，其中副主任医生2人，主治医生5人。全科医护人员基础理论扎实，临床经验丰富，富于协作奉献精神。目前我科已成为集医疗、科研、教学为一体的临床科室','2019-01-22 16:00:00'),(4,'外科','五楼','普通外科是以收治胃肠、肝胆、胰脾、腺体及肛肠良、恶性疾病为主的综合性科室。','2019-01-22 16:00:00'),(5,'内科','六楼','科室主要从事呼吸内科、风湿免疫过敏专业的医疗、教学和科研工作。其学科方向是慢性阻塞性肺疾病（COPD），肺源性心脏病，呼吸衰竭、支气管哮喘、肺部感染、支气管扩张、肺间质纤维化、胸腔积液、肺部肿瘤等的基础和临床研究','2019-01-23 00:51:42'),(6,'五官科','七楼','科主要开展中耳成形术，乳突根治术，食道异物取除术，鼻窦内窥镜手术，喉息肉手术，扁桃体手术，气管异物取除术，喉癌根治术等诊疗技术，专长于鼻窦内窥镜手术，中耳成形术，喉肿物切除术，鼻咽癌介入治疗手术，选择性介入治疗顽固性鼻出血等疾病的治疗。主要收治慢性中耳炎，慢性鼻窦炎，多发性鼻息肉，鼻出血，慢性扁桃体炎，鼻咽癌，颜面部复杂性外伤，耳鼻喉病微波治疗，经硬腭进路鼻咽血管瘤切除术等疾病。','2019-01-22 16:00:00');
