INSERT INTO `inspection_item_list` VALUES (1,1,'谷丙转氨酶','ALT','U/L','GBZAM',42.00,0.00,NULL,'谷丙转氨偏高可能是肝脏收到损害造成的，如患慢性肝炎、肝硬化肝癌等。'),(2,1,'谷草转氨酶','AST','g/L','GCZAM',40.00,0.00,NULL,'肝功能检查中谷草转氨酶升高意味着肝脏损害严重'),(3,1,'总蛋白','TP','g/L','ZDB',80.00,60.00,NULL,'主要是血清中水分减少，使总蛋白浓度相对增高，如呕吐、大量出汗'),(4,1,'白蛋白','ALB','g/L','BDB',55.00,35.00,NULL,'主要用于血液浓缩而致相对性增高，如严重脱水和休克。'),(5,1,'球蛋白','GLB','g/L','QDB',35.00,15.00,NULL,'球蛋白是机体免疫器官制造的，当体内存在病毒等抗原时，球蛋白就会升高。'),(6,1,'白球比','A/G','%','BQB',2.00,1.00,NULL,'白球比值偏低、倒置，可能有慢性肝实质性损害。'),(7,1,'总胆红素','T-BIL','μmol/L','ZDHS',19.00,5.10,'','肝脏发送炎症、坏死、中毒等损害时均可以引起胆红素偏高'),(8,1,'直接胆红素','D-BIL','μmol/L','ZJDHS',5.10,0.00,'','肝内及肝外阻塞性黄疸，胰头癌，毛细胆管型肝炎及其他胆汁瘀滞综合征等。'),(9,1,'间接胆红素','I-BIL','μmol/L','JJDHS',17.10,0.00,'','衰老红细胞被破坏后产生出来的血红蛋白衍化而成。'),(10,1,'碱性磷酸酶','AKP','U/L','JXLSM',129.00,53.00,'','常见于骨病、肝病。'),(11,1,'谷酰转肽酶','GGT','U/L','GXZTM',50.00,11.00,'','乙肝患者体内谷氨酰转移酶若出现过度偏低则可能有重型肝炎，另外，急性乙肝爆发期也可使谷氨酰转移酶出现偏低的情况。'),(12,2,'2','2','2','2',2.00,2.00,NULL,'2');
